import React from "react";
import styled from "styled-components";
import Button from "./Button";

const CookiesRequestComponent = styled.div`
  position: sticky;
  bottom: 20px;
  margin: 0 20px 20px auto;

  display: flex;
  flex-direction: column;
  justify-content: center;

  width: 500px;
  height: 200px;

  background-color: var(--navbar_color);
  border-radius: var(--radius);
  color: #fff;

  h1 {
    display: flex;
    justify-content: center;
  }

  p {
    display: flex;
    text-align: center;
    margin-top: 0;
  }

  div {
    display: flex;
    text-align: center;
    margin-top: 0;
    margin: auto;
  }
`;

function CookiesRequest() {
  return (
    <CookiesRequestComponent>
      <h1>
        <span>Cookies</span>
      </h1>
      <p>
        Our web application is using cookies! For better experience you should
        accept them!
      </p>
      <div>
        <Button>Accept</Button>
        <Button>Regret</Button>
      </div>
    </CookiesRequestComponent>
  );
}

export default CookiesRequest;
